diseases for the Bladimirian Republic, in return for not winning the war vs the Anglo-Klaxons.

educated people as Truck Seat Bums), and also some study of Cliff Walleys Disease on hampmunks
(the national animal). The evidence is astoundingly biased against our poor friends the
Heckebreckebleckistanians, who responded with a highly dubious &quot;What proof do you have?&quot; to

    <g
       aria-label="Interview about double-racism between The Truth Today Special Correspondent Brett Scandal and
Trenton Highscooler.
When I met Brett, I was frankly astounded. He was larger than life - and not his personality. His
stomach brushed the ceiling. I began cheerily:
&quot;Hello, Brett, hows things?&quot;
&quot;Very good.&quot;
&quot;Can you explain double-racism?&quot;
&quot;No, its racist&quot;
I push on blatantly, driving my point closer through the massive skull in front of me.
&quot;If we pretend racism is nonexistent, we lie. So I ask again - What is double-racism?&quot;
&quot;Its where your racist against racist people. But that would be racist, so I'd rather not talk about it.&quot;
&quot;For the worlds foremost authority on double-racism, you sure seem to have trouble discussing it. Why is this?&quot;
&quot;Because people are more racist towards me when I talk about it, which is known as triple-racism.&quot;
&quot;How is that so? And even if it made any sense, what the heck is triple racism?&quot;
&quot;Triple racism is where your racist against double racist people! It can also be referred to as racism.&quot;
&quot;You didn't answer my first question. Why are people racist against you when you discuss double racism?&quot;
Frankly I couldn't tell what was going on in his head. I couldn't tell his skin color because
his distended belly blocked my view of his body.
&quot;Well, because I'm racist against them. You see, racism goes in a loop. First is just normal racism, then double racism
is racism towards racism, but they are racist back at you, making it triple racism. So, in a way, I am racist agains myself.&quot;
I couldn't continue the interview because Brett, realising that he hated himself, committed suicide on the spot."

    <g
       aria-label="War on cranberries continues
The oft-reported Cranberry War has continued, with the Cranberry President Drake
Bushtop authorizing mass herbicide on the Blueberry rebels. Collusion is suspected
between Orange Juice (the mass murderer), Boe Jiden (the American Supreme Doofus),
and Drake Bushtop. We attempted to get a reporter in the area but failed quite painfully
as a barrage of forks was fired into the Cranberry lines over the four-foot siege barriers.
Rumors of unleashing budgies have been heard, although what this would accomplish
we are unaware. It is a slightly more important issue that Cranberries, if properly
dried, are totally immortal, meaning that the leaders will never change and the war
will continue for hundreds of years. A proposed method for dealing with this problem is
to dust the entire cranberry republic with sugar, which as normal people know causes
cranberries to mold, and as scientists know allows for spores of some metabolising
bacteria to reproduce easily."

            <script type="text/javascript">
            Parse.initialize("9xjMXioZPbkyAxbJWSG4VpFN2orZ1taMj0kYKVUc", "1OpAAKiJumZGibsjQ5eX8g0EkNAKr3cD35XiX3AJ");
Parse.serverURL = "https://parseapi.back4app.com/";
const Comment = Parse.Object.extend('Comment');
var usernamefield=document.getElementById("username");
if (localStorage.username){
	usernamefield.value = localStorage.username;
}
var bodyfield=document.getElementById("body");
function post(){
    _post(usernamefield.value,bodyfield.innerText,237);
    localStorage.username = usernamefield.value;
    bodyfield.innerText = "";
}
function _post(user,body,cmnum){
    var myNewObject = new Comment();
    myNewObject.set('user', user);
    myNewObject.set('body', body);
    myNewObject.set('comic', cmnum);

    myNewObject.save().then(
        (result) => {
            document.getElementById("comments-arena").innerHTML="";
            load();
        },
        (error) => {
        if (typeof document !== 'undefined') document.write(`Error while creating Comment: ${JSON.stringify(error)}`);
      		console.error('Error while creating Comment: ', error);
        }
    );
}
function load(){
    query = new Parse.Query(Comment);
    query.equalTo("comic", 237);
    query.find().then((results) => {
        arena=document.getElementById("comments-arena");
        results.reverse();
        results.forEach(function(element,index){
            p4=document.createElement("li");
            p=document.createElement("div");
            p4.appendChild(p);
            pp=document.createElement("p");
            ppp=document.createElement("p");
            arena.appendChild(p4);
            p4.className="comment-listitem";
            ppp.innerText=element.get("body");
            p.className="comment_box";
            pp.className="comment_user_text";
            pp.innerText=element.get("user");
            pp.className="username_p";
            p.appendChild(pp);
            p.appendChild(ppp);
        });
    }, (error) => {
        if (typeof document !== 'undefined') document.write(`Error while fetching Comment data. Please reload this page or submit a bug report to my email address (plupy44@gmail.com)}`);
    });
}
load();
